import React from "react";
import "./style.css";
import "./normalize.css";
import "./all.min.css";
import ".//login&register/css/register-login.css";
function img() {
  var x = document.getElementById("logvo").src;
};
function Login() {
  return (
    <div className="mainContainer">
      <div className="mainBody">  
        <ImageWithTitle id="logo" src="./login&register/images/habit-tracker-gif-looponce.gif" alt="Description"/>
        <h1>Welcome Back.</h1>
        <form>
          <label htmlFor="username">Username:</label>
          <input type="text" id="username" name="username" required />
          <label htmlFor="password">Password:</label>
          <p>
            <input
              type="password"
              name="password"
              id="password"
              required
            />
            <i
              className="far fa-eye"
              id="togglePassword"
              style={{ marginLeft: '-30px', cursor: 'pointer' }}
            ></i>
          </p>
          <input
            type="submit"
            id="loginButton"
            name="loginButton"
            value="Login"
            required
          />
        </form>
        <p className="link">
          Don't have an account?{' '}
          <a href="./register-page.html">Register here</a>
        </p>
      </div>
    </div>
  );
}

export default Login;
